import Head from 'next/head';
import Link from 'next/link';
import Image from 'next/image'
import Navigation from '../components/Navigation';
import NavigationFooter from '../components/NavigationFooter';
import Card from '../components/Card';
import PriceCard from '../components/PriceCard';
import styles from '../styles/home.module.css';

const Index = () => {

return(
  <div>
    <Head>
      <title>MyWebsite</title>
      <meta name="viewport" content="initial-scale=1.0, width=device-width" />
      <link rel="icon" type="image/svg+xml" href="/AZWWLogo2Minified.svg"/>
  {/*    <link rel="shortcut icon" href="/public/favicon.ico" />*/}
    </Head>

{/*      <header className={styles.section0}>
        <p className={styles.headerTop}>Header Top</p>
      </header>*/}

      <Navigation/>

      <main>
        <div className={styles.section1}>
          <div className={styles.section1Container1}>
            <div className={styles.cover}>
              <img src="AZWWLogo1Minified.svg" className={styles.icon1}/>

              <div className={styles.container}>
                <h1>Professional Web Design</h1>
                <h1>and</h1>
                <h1>Management Services</h1>
                <h2>Allowing you to focus on<br/>running your business.</h2>
                {/*<p>Irure enim pariatur excepteur minim ut officia ut sed quis quis irure amet culpa eiusmod fugiat labore labore ut duis esse enim anim nisi ex laboris in consectetur minim officia occaecat nisi laborum duis in tempor est.</p>*/}
              </div>
          {/*</div>*/}

          {/*<div className={styles.section1Container2}>*/}

              {/*<img src="LgstFlipMini.png"/>*/}
            </div>
          </div>

        </div>

        <div className={styles.divider}></div>

        <div className={styles.section2}>
          <h1 className={styles.headerPricing}>Pricing</h1>
          <div className={styles.cardContainer}>
            <PriceCard/>
            {/*<Card/>*/}
            {/*<Card/>*/}
          </div>
        </div>

      </main>

      <div className={styles.divider}></div>

      <NavigationFooter/>

  </div>
  )
};
export default Index;
